    OwnUser.BlogPostsSpacing = 0;var posts = [{"ID":22862255,"Title":"Vecka 34 (33+0)","Content":"<div class=\"template has-area-type\" data-type=\"0\" data-index=\"0\" data-ns-org-contentsize=\"715\"><div class=\"template-content\" style=\"padding-top: 0px; width: 100%;\"><div class=\"area is-top typing\" data-index=\"0\" style=\"width: 100%; left: 0%; padding: 0.41%; position: relative;\" data-type=\"default\"><div class=\"area-content\"><p>Då var vecka 34 här och magen växer så det knakar. Bebis har lagt sig med huvudet neråt enligt barnmorskan. Så det är inte konstigt att jag blir sparkad på revbenen hela tiden. Känns som att dom ska gå av ibland. Tur att det inte är så länge kvar nu. Satt och räknade häromdagen och kom fram till att jag har 25 arbetsdagar kvar om allt går som jag vill. &nbsp;Tänkte jobba till ungefär 2 veckor före beräknad förlossning. Ja, förutsatt att bebis inte vill komma tidigare. Men det ska vi väl inte behöva tro. Då hinner jag vila lite före det är dags. Kan vara behövligt.&nbsp;</p><p>Har märkt på händer och fötter att dom svullnat lite. Märker mest på händerna då jag inte längre får av mig ringarna. Men även på skorna då dom sitter tajtare än vanligt. Men det är ju inte konstigt med tanke på att man gått upp några kilo sedan start. Dom ska dock bort sen så fort jag bara kan börja träna. Såhär står det i alla fall i våran app denna veckan.&nbsp;</p><p><strong data-redactor-tag=\"strong\" data-verified=\"redactor\">Barnet: </strong>Barnet är nu cirka 42 cm från huvud till fot, och väger cirka 2,18 kg i början av veckan och cirka 2,35 kg vid veckans slut. Nu kan barnet själv bekämpa lätta infektioner med sitt immunförsvar. Utrymmet minskar för varje dag och barnets rörelser blir större och långsammare. Kring den här perioden lägger sig en del barn tillrätta. Vissa fixerar huvudet i bäckeningången, medan cirka 3-4 procent av alla barn lägger sig med stjärten eller benen neråt i bäckenet (sätesbjudning/fotbjudning). Man kan då försöka få fostret att vända sig rätt, en så kallad yttre vändning, som görs på förlossningen omkring vecka 37+0.</p><p><strong data-redactor-tag=\"strong\" data-verified=\"redactor\">Mamman: </strong><span data-redactor-tag=\"span\" data-verified=\"redactor\">Vätska kan samlas i kroppen och du märker det till exempel på att dina händer och fötter svullnar - kanske passar inte dina ringar längre? Din blodvolym har ökat med cirka en liter, men från och med nu håller sig blodmängden konstant fram till förlossningen. Från det att du börjat känna barnets rörelser ska du känna liv i magen varje dag. Barnet utför både små och stora rörelser i magen. Du känner inte nödvändigtvis av när det suger på tummen eller gör små griprörelser med händerna men de flesta sparkar och andra större rörelser känns väl, speciellt under den senare delen av graviditeten. Av och till är det dock lugnt i magen - barnet sover flera gånger under ett dygn. De flesta barn är aktiva på kvällen och tidigt på morgonen, men det kan skilja sig från barn till barn hur mycket och hur kraftigt barnet sparkar. Om du är bekymrad över att ditt barn rör sig mindre än vanligt ska du kontakta sjukvården direkt - dag som natt - speciellt om detta sker nära tiden för beräknad förlossning. </span></p></div></div></div></div><div class=\"template has-area-type\" data-type=\"0\" data-index=\"1\" data-ns-org-contentsize=\"715\"><div class=\"template-content\" style=\"padding-top: 67.49%; width: 100%;\"><div class=\"area is-top\" data-index=\"0\" style=\"width: 100%; left: 0%; padding: 0.41%;\" data-type=\"image\"><div class=\"area-content\" style=\"border-radius: 0%;\"><img alt=\"\" itemprop=\"image\" src=\"https://nouwcdn.com/4/900000/840000/838087/pics/2016131205518932838087_sbig.jpg\" id=\"20161312054109790_sbig.jpg\" style=\"display: none; height: 100%; width: 100%;\" data-ns-org-width=\"1680\" data-ns-org-height=\"1160\" data-ns-imagewidth=\"100\"><div style=\"height: 100%; width: 100%; transform: rotate(0deg) scaleX(1); back