EndDate":"2015-12-30T22:48:29.877","LoginCount":2077,"LastIP":"46.236.75.227","AccessLevel":7,"IsAdmin":false,"IsPremium":false,"IsVerified":true,"FirstName":"Emma","LastName":"Bergdahl","Name":"","NameVisibility":0,"Sex":false,"Age":21,"Birthday":"1994-03-22T00:00:00","Folder":"4/900000/840000/838087","PictureName":"201491717426311838087","Picture":{"ID":0,"CreatedDate":"0001-01-01T00:00:00","Content":null,"Url":"https://nouwcdn.com/4/900000/840000/838087/201491717426311838087_small.jpg","Width":0,"Height":0},"Presentation":"21 &#229;r och lyckligt gift med mitt livs k&#228;rlek. Driver denna blogg sedan n&#229;gra &#229;r tillbaka. H&#228;r kan ni l&#228;sa om allt fr&#229;n shopping, sk&#246;nhet, k&#228;rlek och en del av min vardag. I mars ut&#246;kas v&#229;r lilla familj d&#229; vi ber&#228;knas f&#229; v&#229;rat f&#246;rsta barn 18/3.  H&#228;r kan ni f&#246;lja mig och min graviditet. V&#228;lkomna till min blogg!<br><br>KONTAKT: <br>emmamaria.blogg@gmail.com<br>INSTAGRAM: @emmamariaz","BlogDescription":null,"MessageThreadID":3818,"CityID":51,"City":{"ID":51,"Name":"Boden","RegionID":25,"Region":null,"CountryID":1,"Country":null},"CountryID":1,"Country":null,"Language":"en-UK","NotificationsCount":0,"MessagesUnreadCount":0,"MetapicID":1262,"MetapicLanguage":"sv-SE","InstagramID":219133469,"FacebookID":null,"IOSAppVersion":null,"AndroidAppVersion":29.0,"FollowersCount":0,"Followers":null,"BlogUrl":"/emmamariaz","BlogFaviconName":null,"BlogFavicon":null,"BlogHeaderName":"2014818113427354838087wx1152hy168.jpg","BlogHeader":{"ID":0,"CreatedDate":"0001-01-01T00:00:00","Content":null,"Url":"https://nouwcdn.com/4/900000/840000/838087/2014818113427354838087wx1152hy168.jpg","Width":1152,"Height":168},"BlogOfficialCategoryID":null,"BlogCategoryID":22,"BlogCategory":null}},{"ID":22882780,"Title":"För- och nackdelar","Content":"<div class=\"template has-area-type\" data-type=\"0\" data-index=\"1\" data-ns-org-contentsize=\"715\"><div class=\"template-content\" style=\"padding-top: 0px; width: 100%;\"><div class=\"area is-top typing\" data-index=\"0\" style=\"width: 100%; left: 0%; padding: 0.41%; position: relative;\" data-type=\"default\"><div class=\"area-content\"><p>Det finns både för och nackdelar med en graviditet. Självklart så njuter jag så mycket det bara går. Har ändå längtat efter barn så pass länge. Här har ni dom för- och nackdelarna jag har upplevt under min graviditet än så länge.&nbsp;</p><p><strong data-redactor-tag=\"strong\"></strong><strong data-redactor-tag=\"strong\">Fördelar: </strong></p><ul><li>Att ligga och känna på magen och känna alla sparkar.</li><li>Att ha något att skylla på när man vill ha den där extra portionen mat eller extra bullen.</li><li>Att få handla kläder osv till bebis. Finns inget bättre än att kolla på bebis saker.</li><li>Att man kan använda magen som bord. Haha!</li><li>Att man trots alla kilon man gått upp kan känna sig riktigt vacker. </li><li>Att man snart får träffa ett nytt liv. Som jag varit med och skapat.</li><li>Att man inte behöver förklara varför man är så trött hela tiden. </li><li>All hjälp man får.</li></ul><p><strong data-redactor-tag=\"strong\">Nackdelar:</strong></p><ul><li>Att man ständigt är kissnödig. 2 minuter efter man har kissat är man lika kissnödig igen. </li><li>Dom 12 första veckorna av ständigt illamående. Fick inte behålla något alls till en början. </li><li>Att man är så sjukt trött hela tiden och knappt orkar göra någonting. </li><li>Att man inte kommer i sina vanliga kläder längre.</li><li>Att man känner sig stor och klumpig.</li><li>Värken i rygg och höfter.</li><li>Alla extra kilon man lägger på sig.</li><li>Alla hormoner och humörsvängningar. Vet inte hur många gånger jag gråtit för ingenting. Eller fått dåligt samvete för att jag blivit sur för något som egentligen inte är någon stor grej. </li></ul></div></div></div></div><div class=\"template has-area-type\" data-type=\"0\" data-index=\"0\" data-ns-org-contentsize=\"715\"><div class=\"template-content\" style=\"padding-top: 83.3%; width: 65.98%;\"><div class=\"area is-top\" data-index=\"0\" style=\"width: 100%; left: 0%; padding: 0.62%;\" data-type=\"image\"><div class=\"area-content\" style=\"border-radius: 0%;\"><img alt=\"\" itemprop=\"image\" src=\"https://scontent.cdninstagram.com/t51.2885-15/sh0.08/e35/p640x640/12446218_1735880466627955_946000619_n.jpg\" id=\"12446218_1735880466627955_946000619_n.jpg\" data-ns-imagewidth=\"66.014\" style=\"display: none; height: 100%; width: 100%;\"><div data-ns-imagewidth=\"66.014\" style=\"height: 100%; width: 100%; transform: rotate(0deg) scaleX(1); background-image: url(&quot;https://scontent.cdninstagram.com/t51.2885-15/sh0.08/e35/p640x640/12446218_1735880466627955_946000619_n.jpg&quot;); background-size: 100%; background-position: 50% 50%; background-repeat: no-repeat;-webkit-transform: rotate(0deg) scaleX(1);\"></div></div></div></div></div>","ContentText":"Det finns både för och nackdelar med en graviditet. Självklart så njuter jag så mycket det bara går. Har ändå längtat efter barn så pass länge. Här har ni dom för- och nackdelarna jag har upplevt under min graviditet än så länge.  Fördelar: Att ligga och känna på magen och känna alla sparkar. Att ha något att skylla på när man vill ha den där extra portionen mat eller extra bullen. Att få handla kläder osv till bebis. Finns inget bättre än att kolla på bebis saker. Att man kan använda magen som bord. Haha! Att man trots alla kilon man gått upp kan känna sig riktigt vacker. Att man snart får träffa ett nytt liv. Som jag varit med och skapat. Att man inte behöver förklara varför man är så trött hela tiden. All hjälp man får. Nackdelar: Att man ständigt är kissnödig. 2 minuter efter man har kissat är man lika kissnödig igen. Dom 12 första veckorna av ständigt illamående. Fick inte behålla något alls till en början. Att man är så sjukt trött hela tiden och knappt orkar göra någonting. Att man inte kommer i sina vanliga kläder längre. Att man känner sig stor och klumpig. Värken i rygg och höfter. Alla extra kilon man lägger på sig. Alla hormoner och humörsvängningar. Vet inte hur många gånger jag gråtit för ingenting. Eller fått dåligt samvete för att jag blivit sur för något som egentligen inte är någon stor grej.","ContentChanges":null,"CreatedDate":"2016-01-31T10:50:17.633Z","CreatedDateBlogTimeZone":"2016-01-31T11:50:17.633","UpdatedDate":"2016-01-31T11:37:11.573Z","UpdatedDateBlogTimeZone":"2016-01-31T12:37:11.573","PublishedDate":"2016-01-31T11:37:11.573Z","PublishedDateBlogTimeZone":"2016-01-31T12:37:11.573","Status":0,"WebserviceDraft":null,"IsPreviewable":false,"IsFromApp":null,"IsPublishLater":false,"HasBeenPublished":true,"Url":"/emmamariaz/for--och-nackdelar-22882780","FeaturedImage":{"ID":0,"CreatedDate":"0001-01-01T00:00:00","Content":null,"Url":"https://scontent.cdninstagram.com/t51.2885-15/sh0.08/e35/p640x640/12446218_1735880466627955_946000619_n.jpg","Width":640,"Height":800},"FeaturedImageUrl":"https://scontent.cdninstagram.com/t51.2885-15/sh0.08/e35/p640x640/12446218_1735880466627955_946000619_n.jpg","FeaturedImageWidth":640,"FeaturedImageHeight":800,"ViewsCount":29,"LikesCount":0,"CommentsCount":0,"Comments":null,"CommentsIsEnabled":true,"CommentsNeedsApproval":true,"CommentsAnonymousNeedsApproval":false,"CommentsStatus":3,"Latitude":null,"Longitude":null,"Location":null,"LocationLanguage":null,"Category1ID":100017,"Category1":{"ID":100017,"Name":"Allmänt","Slug":"allmänt","UserID":838087},"Category2ID":747628,"Category2":{"ID":747628,"Name":"Graviditeten","Slug":"graviditeten","UserID":838087},"Category3ID":0,"Category3":null,"PollID":null,"UserID":838087,"User":{"Url":"/emmamariaz/profile","ID":838087,"UserName":"Emmamariaz","PasswordConfirm":null,"PasswordRepeat":null,"Email":"emmamaria.blogg@gmail.com","EmailIsVerified":true,"PhoneIsVerified":true,"CreatedDate":"2012-10-11T22:17:39.93","ActiveDate":"2016-01-31T21:52:37.527","ActiveLevel":3,"PremiumEndDate":"2015-12-30T22:48:29.877","LoginCount":2077