blev jag sugen på en till nu. Haha! Vad är det med oss gravida alltså. Vad hade ni läsare för något som ni bara var tvungen att äta när ni var gravida?</p></div></div></div></div><div class=\"template has-area-type\" data-type=\"0\" data-index=\"2\"><div class=\"template-content\" style=\"padding-top:55.47278%;\"><div class=\"area is-top\" data-type=\"image\" style=\"width:100%;left:0%;padding:0.41%;\" data-index=\"0\"><div class=\"area-content\" style=\"\"><img id=\"20161250331271838087_sbig.jpg\" src=\"https://nouwcdn.com/4/900000/840000/838087/pics/20161250331271838087_sbig.jpg\" itemprop=\"image\" style=\"display:none;width:100%;height:100%\" data-ns-imagewidth=\"100\" data-ns-org-width=\"1040\" data-ns-org-height=\"585\" alt=\"\"><div style=\"height: 100%; width: 100%; background-image: url(&quot;https://nouwcdn.com/4/900000/840000/838087/pics/20161250331271838087_sbig.jpg&quot;); background-size: 100%; background-position: 50% 50%; background-repeat: no-repeat;\" data-ns-imagewidth=\"100\" data-ns-org-width=\"1040\" data-ns-org-height=\"585\"></div></div></div></div></div>","ContentText":"I början av graviditeten hade jag inga cravings alls. Är först nu i slutet som dom har kommit. Den som kom först är att jag varje natt måste gå upp och dricka ett glas mjölk. Varför vet jag inte. Men jag vaknar och är bara dödligt sugen på mjölk och så har det varit i några veckor nu. Går fortfarande upp varje natt. Det andra som kom var att jag blev grymt sugen på surt godis. Speciellt dom där vita och bruna sura napparna som finns i lösgodis. Det varade i kanske en och en halv vecka. Sen gick det över. Det som jag har craving på just nu är apelsiner. Vet inte hur många apelsiner jag har ätit på bara någon dag. Får liksom inte nog. Kan äta två stycken och direkt efteråt gå och skära upp två till. På tal om det så blev jag sugen på en till nu. Haha! Vad är det med oss gravida alltså. Vad hade ni läsare för något som ni bara var tvungen att äta när ni var gravida?","ContentCha