år, men är svårt när man jobbar på dagarna. Annars så börjar nervositeten smyga sig på. Kan inte låta bli att tänka på förlossningen. Till och med drömmer om den nästan varje natt nu. Men jag vet att det kommer gå bra. Alla är nog lite nervös. Såhär står det i alla fall i våran app denna veckan.</span><br></p><p><strong data-redactor-tag=\"strong\">Barnet: </strong>Barnet är nu cirka 40 cm lång och väger cirka 1,98 kg i början av veckan och cirka 2,15 kg vid veckans slut. Kroppen fortsätter att lagra underhudsfett. Fostervattenmängden ökar inte längre utan är konstant. Hjärnan växer snabbt och barnets huvud ökar i storlek. Barnet kan nu uppfatta ljus och mörker, till exempel om det är dag eller natt. Barnet fortsätter att röra på sig och det går att känna fosterrörelser flera gånger om dagen.</p><p><strong data-redactor-tag=\"strong\">Mamman: </strong>Om barnet har lagt sig tillrätta kommer det att börja kännas betydligt behagligare för dig - det blir lättare att andas och om du haft magbesvär kan det försvinna nu. Du kan känna ett ökat tryck neråt och stickande eller pirrande känslor i bäckenet, en del kvinnor beskriver det som små elektriska stötar. Det är helt ofarligt. Din aktiviteter påverkar barnet - äter du, sitter, ligger eller går, känner barnet av det. Likaså påverkas han eller hon av ljud utifrån. Det är bra att försöka ha en liten vilostund varje dag. Lyssna gärna på avslappningsövningar. Ju mer avslappnad du lyckas vara under och mellan dina förlossningsvärkar, desto bättre kommer din livmoder att arbeta - så det är bra att börja öva avslappning redan nu!</p></div></div></div></div><div class=\"template has-area-type\" data-type=\"0\" data-index=\"1\" data-ns-org-contentsize=\"715\"><div class=\"template-content\" style=\"padding-top: 67.49%; width: 100%;\"><div class=\"area is-top\" data-index=\"0\" style=\"width: 100%; left: 0%; padding: 0.41%;\" data-type=\"image\"><div class=\"area-content\" style=\"border-radius: 0%;\"><img alt=\"\" itemprop=\"imag