ontent":"<div class=\"template has-area-type\" data-type=\"0\" data-index=\"1\" data-ns-org-contentsize=\"715\"><div class=\"template-content\" style=\"padding-top: 67.49%; width: 100%;\"><div class=\"area is-top\" data-index=\"0\" style=\"width: 100%; left: 0%; padding: 0.41%;\" data-type=\"image\"><div class=\"area-content\" style=\"border-radius: 0%;\"><img alt=\"\" itemprop=\"image\" src=\"https://nouwcdn.com/4/900000/840000/838087/pics/20161182238527620_sbig.jpg\" id=\"20161182238527620_sbig.jpg\" style=\"display: none; height: 100%; width: 100%;\" data-ns-org-width=\"1800\" data-ns-org-height=\"1200\" data-ns-imagewidth=\"100\"><div style=\"height: 100%; width: 100%; transform: rotate(0deg) scaleX(1); background-image: url(https://nouwcdn.com/4/900000/840000/838087/pics/20161182238527620_sbig.jpg); background-size: 100%; background-position: 50% 50%; background-repeat: no-repeat;-webkit-transform: rotate(0deg) scaleX(1);-webkit-transform: rotate(0deg) scaleX(1);transform: rotate(0deg) scaleX(1);\" data-ns-org-width=\"1800\" data-ns-org-height=\"1200\" data-ns-imagewidth=\"100\"></div></div></div></div></div><div class=\"template has-area-type\" data-type=\"0\" data-index=\"3\" data-ns-org-contentsize=\"715\"><div class=\"template-content\" style=\"padding-top: 0px; width: 100%;\"><div class=\"area is-top typing\" data-index=\"0\" style=\"width: 100%; left: 0%; padding: 0.41%; position: relative;\" data-type=\"default\"><div class=\"area-content\"><p>​Sådär då var bb-väskan så gott som färdigpackad. Är endast lite necessär saker som ska med också. Som till exempel tandborste osv om det blir att sova över. Men det packar jag ner när det är dags. Har skrivit en lapp med det sista som ska med och lagt på väskan ifall minnet är dåligt just då. Kändes faktiskt riktigt konstigt att packa väskan. Allt kändes så verkligt och nära på något sätt. Det är det ju också. Är ju bara 8 veckor kvar ungefär. Snart är vi påväg dit.</p><p> Här är vad jag packat i våran bb-väska:</p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\">​<strong data-verified=\"redactor\" data-redactor-tag=\"strong\">​Till bebis:</strong></span><br></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">​Vantar</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\"> Nalledräkt</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Två mössor&nbsp;</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\">Body i strl 50&nbsp;</span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\">Byxor i strl 50</span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\">Strumpor</span><span data-redactor-tag=\"span\" data-verified=\"redactor\"></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\">Body i strl 56</span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\">Byxor i strl 56</span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\">Två olika filtar&nbsp;</span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><strong data-verified=\"redactor\" data-redactor-tag=\"strong\">​Till mig:</strong><br></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">​Amningsbh</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Förlossningsbindor&nbsp;</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Mjukisbyxor&nbsp;</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Amningskupor&nbsp;</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Vattenflaska</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Stora&nbsp;sköna trosor</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Hårborste&nbsp;</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Lypsyl&nbsp;</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Deo&nbsp;</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Våtservetter</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Tofflor&nbsp;</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Snoddar&nbsp;</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\">Detta är vad som är i väskan just nu. Valde att inte packa ner så mycket kläder till bebis. Eftersom man brukar få låna på BB. Även blöjor lämnar vi hemma eftersom det finns där med. Känns bara onödigt att ta med det då. Lypsyl fick följa med eftersom jag har hört att man kan bli väldigt torr om läpparna om man tar lustgas. Kommer komplettera det sista som ska med den dagen det är dags att åka in.&nbsp;</span></span></p><p><span data-redactor-tag=\"span\" data-verified=\"redactor\"><span data-verified=\"redactor\" data-redactor-tag=\"span\"><br></span></span></p></div></div></div></div>","ContentText":"?Sådär då var bb-väskan så gott som färdigpackad. Är endast lite necessär saker som ska med också. Som till exempel tandborste osv om det blir att sova över. Men det packar jag ner när det är dags. Har skrivit en lapp med det sista som ska med och lagt på väskan ifall minnet är dåligt just då. Kändes faktiskt riktigt konstigt att packa väskan. Allt kändes så verkligt och nära på något sätt. Det är det ju också. Är ju bara 8 veckor kvar ungefär. Snart är vi påväg dit. Här är vad jag packat i våran bb-väska: ? ?Till bebis: ?Vantar Nalledräkt Två mössor  Body i strl 50  Byxor i strl 50 Strumpor Body i strl 56 Byxor i strl 56 Två olika filtar  ?Till mig: ?Amningsbh Förlossningsbindor  Mjukisbyxor  Amningskupor  Vattenflaska Stora sköna trosor Hårborste  Lypsyl  Deo  Våtservetter Tofflor  Snoddar  Detta är vad som är i väskan just nu. Valde att inte packa ner så mycket kläder till bebis. Eftersom man brukar få låna på BB. Även blöjor lämnar vi hemma eftersom det finns där med. Känns bara onödigt att ta med det då. Lypsyl fick följa med eftersom jag har hört att man kan bli väldigt torr om läpparna om man tar lustgas. Kommer komplettera det sista som ska med den dagen det är dags att åka in. ","ContentChanges":null,"CreatedDate":"2015-12-19T11:01:02.227Z","CreatedDateBlogTimeZone":"2015-12-19T12:01:02.227","UpdatedDate":"2016-01-19T17:00:15.483Z","UpdatedDateBlogTimeZone":"2016-01-19T18:00:15.483","PublishedDate":"2016-01-19T17:00:15.483Z","PublishedDateBlogTimeZone":"2016-01-19T18:00:15.483","Status":0,"WebserviceDraft":null,"IsPreviewable":false,"IsFromApp":null,"IsPublishLater":false,"HasBeenPublished":true,"Url":"/emmamariaz/packa-bb-vaskan-21896127","FeaturedImage":{"ID":0,"CreatedDate":"0001-01-01T00:00:00","Content":null,"Url":"https://nouwcdn.com/4/900000/840000/838087/pics/20161182238527620_sbig.jpg","Width":1800,"Height":1200},"FeaturedImageUrl":"https://nouwcdn.com/4/900000/840000/838087/pics/20161182238527620_sbig.jpg","FeaturedImageWidth":1800,"FeaturedImageHeight":1