try":null,"Language":"en-UK","NotificationsCount":0,"MessagesUnreadCount":0,"MetapicID":1262,"MetapicLanguage":"sv-SE","InstagramID":219133469,"FacebookID":null,"IOSAppVersion":null,"AndroidAppVersion":29.0,"FollowersCount":0,"Followers":null,"BlogUrl":"/emmamariaz","BlogFaviconName":null,"BlogFavicon":null,"BlogHeaderName":"2014818113427354838087wx1152hy168.jpg","BlogHeader":{"ID":0,"CreatedDate":"0001-01-01T00:00:00","Content":null,"Url":"https://nouwcdn.com/4/900000/840000/838087/2014818113427354838087wx1152hy168.jpg","Width":1152,"Height":168},"BlogOfficialCategoryID":null,"BlogCategoryID":22,"BlogCategory":null}},{"ID":22500992,"Title":"Vecka 32 (31+1)","Content":"<div class=\"template has-area-type\" data-type=\"0\" data-index=\"0\" data-ns-org-contentsize=\"715\"><div class=\"template-content\" style=\"padding-top: 0px; width: 100%;\"><div class=\"area is-top typing\" data-index=\"0\" style=\"width: 100%; left: 0%; padding: 0.41%; position: relative;\" data-type=\"default\"><div class=\"area-content\"><p>Då var vi inne i vecka 32. Nu springer tiden iväg rasande fort. Tycker inte vi gör annat än byta veckor hela tiden. Snart är du här. Tycker att magen börjar bli stor nu. Når knappt längre att knyta skorna eller ta på mig strumporna. Snart får Andreas hjälpa mig med det. Haha! Magen känns också mycket tyngre vilket har gjort att jag nästan hela tiden har ont i ryggen. Nu längtar jag tills magen är borta och jag kan börja träna bort alla gravidkilon. Väskan som ska följa med oss till bb ska jag packa klart imorgon så den är klar. Då ska ni få höra vad jag valt att packa ner.&nbsp;Såhär står det i våran app denna veckan.&nbsp;</p><p><strong data-redactor-tag=\"strong\" data-verified=\"redactor\">Barnet: </strong>Barnets totala längd är nu ca 42 cm och det väger ca 1,79 kg i början av veckan och ca 1,95 kg vid veckans slut. Barnets alla fem sinnen fungerar. Barnet sover stor del av tiden, under de vakna perioderna tränar barnet på att andas, röra sig och öppna och stänga sina ögon. De inre organen fortsätter att mogna och lungorna förbereder sig inför den riktiga andningen. </p><p><strong data-redactor-tag=\"strong\" data-verified=\"redactor\">Mamman: </strong>Förvånas du över hur fort din mage växer? Nu när halva barnets födelsevikt (cirka) är uppnådd, ska den fördubbla sin vikt under de sista 8-10 veckorna under graviditeten - något som kommer att märkas på din mage, och din vikt ökar snabbare nu. Vila så ofta du kan!</p><p>Den stora livmodern trycker på dina inre organ, bland annat magsäcken och du kan uppleva att du blir mätt snabbare. Du känner helt enkelt att det \"inte får plats\". Sikta på att äta mindre måltider, och lite oftare än vanligt. </p></div></div></div></div><div class=\"template has-area-type\" data-type=\"0\" data-index=\"1\" data-ns-org-contentsize=\"715\"><div class=\"template-content\" style=\"padding-top: 67.49%; width: 100%;\"><div class=\"area is-top\" data-index=\"0\" style=\"width: 100%; left: 0%; padding: 0.41%;\" data-type=\"image\"><div class=\"area-content\" style=\"border-radius: 0%;\"><img alt=\"\" itemprop=\"image\" src=\"https://nouwcdn.com/4/900000/840000/838087/pics/2016117194225310838087_sbig.jpg\" id=\"20161171941109360_sbig.jpg\" style=\"display: none; height: 100%; width: 100%;\" data-ns-org-width=\"1593\" data-ns-org-height=\"1198\" data-ns-imagewidth=\"100\"><div style=\"height: 100%; width: 100%; transform: rotate(0deg) scaleX(1); background-image: url(&quot;https://nouwcdn.com/4/900000/840000/838087/pics/2016117194225310838087_sbig.jpg&quot;); background-size: 100%; background-position: 45% 100%; background-repeat: no-repeat;-webkit-transform: rotate(0deg) scaleX(1);\" data-ns-org-width=\"1593\" data-ns-org-height=\"1198\" data-ns-imagewidth=\"100\"></div></div></div></div></div>","ContentText":"Då var vi inne i vecka 32. Nu springer tiden iväg rasande fort. Tycker inte vi gör annat än byta veckor hela tiden. Snart är du här. Tycker att magen börjar bli stor nu. Når knappt läng