wcdn.com/4/900000/840000/838087/pics/2016117194225310838087_sbig.jpg","FeaturedImageWidth":1593,"FeaturedImageHeight":1198,"ViewsCount":185,"LikesCount":0,"CommentsCount":0,"Comments":null,"CommentsIsEnabled":true,"CommentsNeedsApproval":true,"CommentsAnonymousNeedsApproval":false,"CommentsStatus":3,"Latitude":null,"Longitude":null,"Location":null,"LocationLanguage":null,"Category1ID":100017,"Category1":{"ID":100017,"Name":"Allmänt","Slug":"allmänt","UserID":838087},"Category2ID":747628,"Category2":{"ID":747628,"Name":"Graviditeten","Slug":"graviditeten","UserID":838087},"Category3ID":0,"Category3":null,"PollID":null,"UserID":838087,"User":{"Url":"/emmamariaz/profile","ID":838087,"UserName":"Emmamariaz","PasswordConfirm":null,"PasswordRepeat":null,"Email":"emmamaria.blogg@gmail.com","EmailIsVerified":true,"PhoneIsVerified":true,"CreatedDate":"2012-10-11T22:17:39.93","ActiveDate":"2016-01-31T21:52:37.527","ActiveLevel":3,"PremiumEndDate":"2015-12-30T22:48:29.877","LoginCount":2077,"LastIP":"46.236.75.227","AccessLevel":7,"IsAdmin":false,"IsPremium":false,"IsVerified":true,"FirstName":"Emma","LastName":"Bergdahl","Name":"","NameVisibility":0,"Sex":false,"Age":21,"Birthday":"1994-03-22T00:00:00","Folder":"4/900000/840000/838087","PictureName":"201491717426311838087","Picture":{"ID":0,"CreatedDate":"0001-01-01T00:00:00","Content":null,"Url":"https://nouwcdn.com/4/900000/840000/838087/201491717426311838087_small.jpg","Width":0,"Height":0},"Presentation":"21 &#229;r och lyckligt gift med mitt livs k&#228;rlek. Driver denna blogg sedan n&#229;gra &#229;r tillbaka. H&#228;r kan ni l&#228;sa om allt fr&#229;n shopping, sk&#246;nhet, k&#228;rlek och en del av min vardag. I mars ut&#246;kas v&#229;r lilla familj d&#229; vi ber&#228;knas f&#229; v&#229;rat f&#246;rsta barn 18/3.  H&#228;r kan ni f&#246;lja mig och min graviditet. V&#228;lkomna till min blogg!<br><br>KONTAKT: <br>emmamaria.blogg@gmail.com<br>INSTAGRAM: @emmamariaz","BlogDescription":null,"MessageThreadID":3818,"CityID":51,"City":{"ID":51,"Name":"Boden","RegionID":25,"Region":null,"CountryID":1,"Country":null},"CountryID":1,"Country":null,"Language":"en-UK","NotificationsCount":0,"MessagesUnreadCount":0,"MetapicID":1262,"MetapicLanguage":"sv-SE","InstagramID":219133469,"FacebookID":null,"IOSAppVersion":null,"AndroidAppVersion":29.0,"FollowersCount":0,"Followers":null,"BlogUrl":"/emmamariaz","BlogFaviconName":null,"BlogFavicon":null,"BlogHeaderName":"2014818113427354838087wx1152hy168.jpg","BlogHeader":{"ID":0,"CreatedDate":"0001-01-01T00:00:00","Content":null,"Url":"https://nouwcdn.com/4/900000/840000/838087/2014818113427354838087wx1152hy168.jpg","Width":1152,"Height":168},"BlogOfficialCategoryID":null,"BlogCategoryID":22,"BlogCategory":null}},{"ID":22403412,"Title":"Barnmorskan vecka 31","Content":"På morgonen var det dags för ett besök hos barnmorskan igen. Denna gången var det bara en liten kontroll. Vi tog blodtryck, mätte samt lyssnade på hjärtat. Allt såg jättebra ut sa barnmorskan. Blir alltid lika glad att höra det. Med tanke på hur det gick förra gången. Nu vill jag helst ha dig i famnen. Börjar bli less på att vara gravid. Vet att alla säger att man ska njuta så mycket man bara kan under graviditeten. Men nu har jag kommit in i en period när jag är dödligt trött hela tiden. Spelar ingen roll hur mycket jag sover. Är lika trött ändå när jag vaknar. Dessutom så börjar jag få ont i kroppen. Men det är ju inte så länge kvar. Snart får vi se dig. Nästa gång jag ska till barnmorskan är om två veckor och så kommer det fortsätta tills jag ska föda. ","ContentText":"På morgonen var det dags för ett besök hos barnmorskan igen. Denna gången var det bara en liten kontroll. Vi tog blodtryck, mätte samt lyssnade på hjärtat. Allt såg jättebra ut sa barnmorskan. Blir alltid lika glad att höra det. Med tanke på hur det gick förra gången. Nu vill jag helst ha dig i famnen. Börjar bli less på att vara gravid. Vet att alla säger att man ska njuta så mycket man bara kan under graviditeten. Men nu har jag kommit in i en period när jag är dödligt trött hela tiden. Spelar ingen roll hur mycket jag sover. Är lika trött ändå när jag vaknar. Dessutom så börjar jag få ont i kroppen. Men det är ju inte så länge kvar. Snart får vi se dig. Nästa gång jag ska till barnmorskan är om två veckor och så kommer det fortsätta tills jag ska föda.","ContentChanges":null,"CreatedDate":"2016-01-13T08:42:42.34Z","CreatedDateBlogTimeZone":"2016-01-13T09:42:42.34","UpdatedDate":"2016-01-13T08:42:42.34Z","UpdatedDateBlogTimeZone":"2016-01-13T09:42:42.34","PublishedDate":"2016-01-13T08:42:42.34Z","PublishedDateBlogTimeZone":"2016-01-13T09:42:42.34","Status":0,"WebserviceDraft":null,"IsPreviewable":false,"IsFromApp":null,"IsPublishLater":false,"HasBeenPublished":true,"Url":"/emmamariaz/barnmorskan-vecka-31-22403412","FeaturedImage":null,"FeaturedImageUrl":null,"FeaturedImageWidth":null,"FeaturedImageHeight":null,"ViewsCount":209,"LikesCount":0,"CommentsCount":0,"Comments":null,"CommentsIsEnabled":true,"CommentsNeedsApproval":true,"CommentsAnonymousNeedsApproval":false,"CommentsStatus":3,"Latitude":0.0,"Longitude":0.0,"Location":null,"LocationLanguage":null,"Category1ID":100017,"Category1":{"ID":100017,"Name":"Allmänt","Slug":"allmänt","UserID":838087},"Category2ID":747628,"Category2":{"ID":747628,"Name":"Graviditeten","Slug":"graviditeten","UserID":838087},"Category3ID":0,"Category3":null,"PollID":null,"UserID":838087,"User":{"Url":"/emmamariaz/profile","ID":838087,"UserName":"Emmamariaz","PasswordConfirm":null,"PasswordRepeat":null,"Email":"emmamaria.blogg@gmail.com","EmailIsVerified":true,"PhoneIsVerified":true,"CreatedDate":"2012-10-11T22:17:39.93","ActiveDate":"2016-01-31T21:52:37.527","ActiveLevel":3,"PremiumEndDate":"2015-12-30T22:48:29.877","LoginCount":2077,"LastIP":"46.236.75.227","AccessLevel":7,"IsAdmin":false,"IsPremium":false,"IsVerified":true,"FirstName":"Emma","LastName":"Bergdahl","Name":"","NameVisibility":0,"Sex":false,"Age":21,"Birthday":"1994-03-22T00:0