tyngre i kroppen och blir mycket lättare andfådd. Bara att gå upp för trappen till lägenheten eller en kort promenad gör mig ganska så andfådd. Har vissa nätter svårt att överhuvudtaget kunna sova. Har även börjat känna ett tryck upp mot bröstkorgen. Antar att det är för att magen växer. Ibland kan jag även känna en fot sparka mig just under bröstet.&nbsp;Såhär står det i appen denna veckan.</p><p><strong data-redactor-tag=\"strong\">Barnet: </strong>Barnets totala längd är nu ca 40 cm och det väger ca 1,6 kg i början av veckan och ca 1,76 kg vid veckans slut. Barnet behöver nu i princip bara gå upp i vikt. Alla organ är snart färdigutvecklade, lungorna är det organ som blir färdigt sist. Barnet har ofta ögonen öppna när det är vaket och aktivt och blundar när det är passivt och sover.</p><p><strong data-redactor-tag=\"strong\">Mamman: </strong><span data-redactor-tag=\"span\">Kroppen förbereder sig på förlossningen och på den kommande tiden som förälder. Du kanske sover sämre, vaknar ofta och har svårt att koncentrera dig. Ju närmare förlossningen du kommer, desto mer vänder du din uppmärksamhet mot ditt ofödda barn, man blir introvert och börjar den mentala förberedelsen. </span></p></div></div></div></div><div class=\"template has-area-type\" data-type=\"0\" data-index=\"1\" data-ns-org-contentsize=\"715\"><div class=\"template-content\" style=\"padding-top: 67.49%; width: 100%;\"><div class=\"area is-top\" data-index=\"0\" style=\"width: 100%; left: 0%; padding: 0.41%;\" data-type=\"image\"><div class=\"area-content\" style=\"border-radius: 0%;\"><img alt=\"\" itemprop=\"image\" src=\"https://nouwcdn.com/4/900000/840000/838087/pics/201611020114863838087_sbig.jpg\" id=\"2016110200418160_sbig.jpg\" style=\"display: none; height: 100%; width: 100%;\" data-ns-org-width=\"1601\" data-ns-org-height=\"1140\" data-ns-imagewidth=\"100\"><div style=\"height: 100%; width: 100%; transform: rotate(0deg) scaleX(1); background-image: url(&quot;https://nouwcdn.com/4/900000/8400